import React from 'react';
import styled, { css } from 'styled-components';

import RemoteMypage from '../images/remote-mypage1.png';
import RemoteLogout from '../images/remote-logout1.png';
import RemoteIntro from '../images/remote-intro1.png';
import RemoteMak from '../images/remote-mak1.png';
import RemoteBrew from '../images/remote-brew1.png';

const Nav = () => {
  const remoteMypage = RemoteMypage;
  const remoteLogout = RemoteLogout;
  const remoteIntro = RemoteIntro;
  const remoteMak = RemoteMak;
  const remoteBrew = RemoteBrew;

  //   const Button = styled.button`
  //     background-color: white;
  //     border: none;
  //     width: 50px;
  //     height: 50px;
  //     &:hover:before {
  //       background-color: #e7d1bf;
  //       width: 2rem;
  //       height: 2rem;
  //       content: 'Mypage';
  //       color: white;
  //     }
  //   `;
  const Button1 = styled.button`
    background-color: white;
    border: none;
    width: 50px;
    height: 50px;

    &:hover:before {
      background-color: #e7d1bf;
      width: 2rem;
      height: 2rem;
      content: '로그아웃';
      color: white;
      ${props =>
        //   props.back &&
        css`
          width: 100px;
          height: 30px;
          background-color: orange;
        `}
    }
  `;

  const Container = styled.div`
    width: 80px;
    padding-top: 80px;
    border: 1px solid black;
  `;

  //   const HoverEvent = styled.div`
  //     background-color: white;
  //     border: none;
  //     width: 50px;
  //     height: 50px;
  //     &:hover:before {
  //       background-color: #e7d1bf;
  //       width: 2rem;
  //       height: 2rem;
  //       content: '로그아웃';
  //       color: white;
  //     }
  //   `;

  const Button = styled.button`
    background-color: white;
    border: none;
    width: 50px;
    height: 50px;
    &:hover {
      background-color: #c29b86;
      content: 'Mypage';
      font-size: 20px;
      width: 140px;
      height: 55px;
      color: red;
      text-align: left;
    }
    &:hover:after {
      content: 'Mypage';
      color: white;
      font-size: 20px;
      text-align: center;
      vertical-align: text-top;
      padding: 5px 1px;
    }
  `;

  const Img = styled.img`
    width: 2.7rem;
    height: 2.7rem;
    &:hover {
      ${props =>
        props.dd &&
        css`
          width: 2.8rem;
          height: 2.8rem;
          /* --webkit-filter : opacity(.50) invert(10) drop-shadow(0 0 10 white); */
          filter: opacity(0.9) invert(10) drop-shadow(0 0 0 white);
        `}
    }
  `;

  // return (
  //     <div>
  //         <Button>
  //             <Img src={remoteIntro} alt="intro" dd/>
  //         </Button>
  //     </div>
  // );

  return (
    <div>
      <Container>
        {/* <Button1 back>
          <img src={remoteMypage} alt="mypage" width="50px" height="50px" />
        </Button1> */}
        <div>
          <Button>
            <Img src={remoteIntro} alt="intro" dd />
          </Button>
        </div>

        <Button>
          <img src={remoteLogout} alt="logout" width="50px" height="50px" />
        </Button>
        <p />
        <Button>
          <img src={remoteIntro} alt="intro" width="50px" height="50px" />
        </Button>
        <p />
        <Button>
          <img src={remoteMak} alt="mak" width="50px" height="50px" />
        </Button>
        <p />
        <Button>
          <img src={remoteBrew} alt="brew" width="50px" height="50px" />
        </Button>
      </Container>
    </div>
  );
};

export default Nav;
